	public HiExerciseInfo toExerciseInfoFrom(HiExercise e) {
		if (e == null) {
			return null;
		}

		HiExerciseInfo ei = new HiExerciseInfo();

		ei.setBodyPart1(e.getBodyPart1());
		ei.setBodyPart1(e.getBodyPart2());
		ei.setDifficulty(e.getDifficulty());
		ei.setEnduranceSecMax(e.getEnduranceSecMax());
		ei.setFitness1(e.getFitness1());
		ei.setFitness2(e.getFitness2());
		ei.setId(e.getId());
//		ei.setIndividualEnduranceSecMax(individualEnduranceSecMax);
//		ei.setIndividualPerformedNoMax(individualPerformedNoMax);
		ei.setUnilateral(e.getUnilateral());
		ei.setName(e.getName());
		ei.setPerformedNo10s(e.getPerformedNo10s());
		ei.setPerformedNo20s(e.getPerformedNo20s());
		ei.setPerformedNo30s(e.getPerformedNo30s());
		ei.setPerformedNoMax(e.getPerformedNoMax());
		ei.setPlaceGym(e.getPlaceGym());
		ei.setPlaceHome(e.getPlaceHome());
		ei.setPlaceIndoor(e.getPlaceIndoor());
		ei.setPlaceOutdoor(e.getPlaceOutdoor());
//		ei.setSuggestedEnduranceSecMax(suggestedEnduranceSecMax);
//		ei.setSuggestedPerformedNoMax(suggestedPerformedNoMax);
//		ei.setSuggestedWeightDumbbell(suggestedWeightDumbbell);
//		ei.setSuggestedWeightLowerPart(suggestedWeightLowerPart);
//		ei.setSuggestedWeightUpperPart(suggestedWeightUpperPart);
		ei.setTool(e.getTool());

		return ei;
	}

